import React from 'react';
import {View, Text, StyleSheet, TouchableOpacity, Alert} from 'react-native';

export default function App() {
  const handlePress = () => {
    Alert.alert('¬°Hola!', 'Tu app Haitian Fashion est√° funcionando');
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>üõçÔ∏è Haitian Fashion</Text>
      <Text style={styles.subtitle}>Tu tienda de moda en Las Palmas</Text>
      
      <TouchableOpacity style={styles.button} onPress={handlePress}>
        <Text style={styles.buttonText}>Ver Productos</Text>
      </TouchableOpacity>
      
      <Text style={styles.description}>
        Bienvenido a Haitian Fashion - Tu app iOS est√° funcionando correctamente
      </Text>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
    alignItems: 'center',
    justifyContent: 'center',
    padding: 20,
  },
  title: {
    fontSize: 32,
    fontWeight: 'bold',
    color: '#000',
    marginBottom: 10,
    textAlign: 'center',
  },
  subtitle: {
    fontSize: 18,
    color: '#666',
    marginBottom: 30,
    textAlign: 'center',
  },
  button: {
    backgroundColor: '#000',
    paddingHorizontal: 30,
    paddingVertical: 15,
    borderRadius: 25,
    marginBottom: 30,
  },
  buttonText: {
    color: '#fff',
    fontSize: 16,
    fontWeight: 'bold',
  },
  description: {
    fontSize: 14,
    color: '#666',
    textAlign: 'center',
    lineHeight: 20,
  },
});
